export function websocketPromise(action) {
  let ws;
  ws = new WebSocket('ws://47.96.224.206:8080/ws/monitor');
  ws.onopen = (wtr) => {
    ws.send('12321');
  };
  ws.onmessage = function ({ data }) {
    if (data.indexOf('monitorCPU') > -1) {
      let list = eval('(' + data + ')');
      action(list);
    }
  };
  ws.onclose = function (evt) {
    console.log('Connection closed.');
  };
  return ws;
}

